OBJET:
- nouer et entretenir des relations amicales entre les anciens élèves de l’École et utiliser les rapports ainsi établis, aussi bien au profit de l'intérêt général qu'au profit des associés eux mêmes ;
- contribuer à assurer à ses membres des fonctions ou des emplois, tant en France qu'à l'étranger ;
- favoriser entre ses membres les échanges scientifiques et techniques ;
- venir en aide à ses membres, moralement et matériellement et le cas échéant, à leur conjoint survivant, enfants ou ascendants directs dans le besoin.

- établir et maintenir entre tous les anciens élèves diplômés de l’École Centrale de Lyon des relations d'amitié et de solidarité et d'établir des liens privilégiés entre Anciens Élèves et Élèves (vie à l'école, parrainage, conférences...) ;
- défendre les droits de ses membres lorsque sont en jeu les intérêts généraux des Centraliens de Lyon ou de l’École ;
- assurer la défense du titre et du diplôme d'ingénieur de Centrale de Lyon et, à cet effet, d'intervenir soit sur le plan amiable, soit sur le plan contentieux, en toutes circonstances où soit ce titre, soit ce diplôme seraient mis en cause, notamment dans des conditions de nature à porter atteinte à leur prestige et à leur rayonnement ;
- promouvoir l’École et son diplôme en contribuant avec le Conseil d'Administration et la Direction de l’École à ce que les Enseignements prodigués à l’École s'adaptent en permanence aux besoins évolutifs de l économie et à ce que la qualité du recrutement des élèves demeure au niveau le plus élevé ;
- faciliter les moyens d'étendre leurs connaissances générales, culturelles, techniques et professionnelles ;
- venir en aide à ses membres, et le cas échéant, à leurs conjoints, ascendants et descendants ;
- contribuer au rayonnement de la communauté des Centraliens de Lyon.

a) entretenir le culte du souvenir des camarades tombés au champ d’honneur ;
b) maintenir et resserrer les liens de camaraderie entre les écrivains combattants ;
c) défendre leurs intérêts professionnels ;
d) étudier les réformes qui s’imposent dans le monde de l’édition, des revues, du journalisme, du théâtre, de la radio-télévision et du cinématographe et de faire connaître le point de vue des combattants ;
e) lutter pour faire appliquer ce point de vue en faveur des écrivains combattants, par les directeurs de revues et de journaux, directeurs de théâtres et entreprises cinématographiques ou de radiodiffusion.
f) accueillir et fédérer des associations partageant les valeurs de l’AEC et œuvrant dans le domaine littéraire, en particulier pour perpétuer la mémoire d’écrivains combattants ;
g) entreprendre toutes actions de défense et de promotion de la langue française.

- assurer le développement et le rayonnement du mémorial national aux marins morts pour la France situé à la pointe Saint-Mathieu en la commune de Plougonvelin ;
- accompagner et si besoin soutenir moralement les familles des marins disparus ;
- transmettre la mémoire des marins disparus aux générations futures en prenant en compte culturel du développement durable ;
- promouvoir toute action concernant la mémoire des marins, quelles que soient les circonstances de leur disparition ;
- mener toute opération jugée nécessaire pour permettre d'assurer le développement du mémorial et de son environnement, son rayonnement et la pérennité de son objet.

• assurer, tant en France qu’à l’Étranger, la défense du titre et du diplôme d’Ingénieur et autres diplômes délivrés par l’ESPCI ParisTech et à cet effet d'intervenir, soit sur le plan amiable, soit sur le plan contentieux (et dans ce dernier cas, tant en demande qu’en défense) dans toutes les circonstances où soit ce titre, soit ce diplôme, seraient mis en cause, notamment dans des conditions de nature à porter atteinte à leur existence, leur reconnaissance, leur prestige et leur rayonnement ;
• promouvoir les métiers de l’ingénieur pour leur contribution au développement scientifique, économique et social et pour leur rôle dans le rapprochement entre les mondes de l’enseignement, de la recherche et de l’industrie ;
• aider au développement et au rayonnement de l’ESPCI ParisTech ;
• venir en aide aux membres de l’Association, aux élèves de l’ESPCI ParisTech et, le cas échéant, à leurs conjoints, ascendants ou descendants ;
• assister ses membres pour l’accès aux fonctions et emplois qui leur permettent de mettre en valeur leurs connaissances et leurs qualités ;
• établir entre tous ses membres des relations amicales, de relier successivement les promotions nouvelles aux promotions antérieures et utiliser les rapports ainsi créés aussi bien dans l’intérêt général qu’au bénéfice des membres eux-mêmes ;
• représenter en toutes circonstances l’ensemble de ses membres et pourvoir à la défense des intérêts qu’en cette qualité ils ont en commun ;
• réunir, conserver et mettre à disposition toute documentation ou information à valeur historique tant pour l’ESPCI ParisTech que pour ses diplômés.

- susciter, coordonner l'action éducative, récréative, sportive, culturelle et civique de ses associations membres et d'assurer d'une façon plus générale, le développement de l'éducation populaire permanente ;
- définir les principes fondamentaux de l'action éducative et d'en contrôler l'application ;
- représenter l'ensemble des MJC regroupées en fédérations régionales, d'établir et de développer des relations avec les organismes similaires en France et à l'étranger ;
- promouvoir en permanence une recherche appliquée aux besoins, aux méthodes et aux moyens éducatifs.

- procurer aux enfants d'âge scolaire des vacances salutaires en placement familial sélectionné ;
- organiser, surveiller et animer ces séjours ;
- accueillir dans ses locaux tout groupe d'enfants ou adultes désirant passer un séjour de vacances à la montagne.

a) unir, fédérer, promouvoir et soutenir les associations de parents, de personnes handicapées et de leurs amis et les organismes qui œuvrent à la défense et à la promotion des intérêts matériels et moraux des personnes handicapées et de leurs familles ;
- Sont considérés comme parents – au sens des présents statuts- les parents de personnes handicapées, leurs ascendants, leurs descendants, leurs collatéraux et leurs alliés jusqu’au 3ème degré et toute personne qui entretient des liens étroits et stables avec ces personnes.
- Sont considérées comme personnes handicapées – au sens des présents statuts - les personnes qui ont un retard global des acquisitions et une limitation des capacités adaptatives et qui ont des difficultés durables à se représenter elles-mêmes, qu’il s’agisse notamment de la déficience intellectuelle ou cognitive, de polyhandicap, d’autisme, d’infirmité motrice-cérébrale et de handicap psychique.
b) promouvoir l’action de ses membres et notamment l’élaboration de réponses apportées aux besoins des personnes handicapées et de leurs familles ;
c) promouvoir l’image des personnes handicapées et de favoriser leur inclusion dans la société ;
d) mener ou susciter des études et des recherches afin de développer les connaissances scientifiques, médicales, techniques et éducatives afin d’améliorer les réponses aux besoins des personnes handicapées ;
e) représenter auprès des pouvoirs publics et devant toutes juridictions ou instances, tant au niveau national qu’international, ses membres ainsi que les personnes handicapées et leurs familles.
